type thing = { facebook: type2; pokemon: type2 };

type type2 = {
  like: string;
  love: string;
  haha: string;
  wow: string;
  sad: string;
  angry: string;
};

const list: thing = {
  facebook: {
    like: 'data:image/png;base64,',
    love: 'data:image/png;base64,',
    haha: 'data:image/png;base64,',
    wow: 'data:image/png;base64,',
    sad: 'data:image/png;base64,',
    angry:
      'data:image/png;base64,',
  },
  pokemon: {
    like: 'data:image/png;base64,',
    love: 'data:image/png;base64,',
    haha: 'data:image/png;base64,',
    wow: 'data:image/png;base64,',
    sad: 'data:image/png;base64,',
    angry:
      'data:image/png;base64,',
  },
};

export const icons = {
  find: (scope: string, name: string): any => {
    return (
      (list[scope as keyof thing] &&
        list[scope as keyof thing][name as keyof type2]) ||
      'n/a'
    );
  },
};
